import './App.css';
import {BrowserRouter as Router,Route,Routes} from "react-router-dom";
import React,{Component,Fragment} from "react";
import Header from "./component/main/Header"
import Home from "./component/main/Home"
import Region from "./component/food/Region"
import Menu from "./component/food/Menu"
import Footer from "./component/main/Footer";
import jqueryBacktotop from "./component/main/jquery.backtotop";

const App = () => {
  return (
    <Router>
      <Fragment>
        <Header/>
          <Routes>
            <Route path={"/"} element={<Home/>}/>
            <Route path={"/food/region"} element={<Region/>} />
            <Route path={"/food/menu"} element={<Menu/>} />
          </Routes>
        <Footer/>
      </Fragment>
    </Router>
  );
}

export default App;
